import React from 'react';
import { Card } from 'react-bootstrap';

function CurrentWeather(props) {
  const { weather } = props;
  console.log(weather)
  // const { weather } = props.weather;

  if (!props.weather) {
    return 'Loading...'
  }

  return (
    <Card>
        <Card.Body>
          <div>
          {/* {weather[0].icon} */}
          {weather[0].main}
          {weather[0].description}
          </div>
        </Card.Body>
    </Card>
  );
}

export default CurrentWeather;
